import React from "react";

// Titre, localisation et tag de chaque logement
export default function HeaderLogement(props) {
  const title = props.logement.title;
  const location = props.logement.description;

  return (
    <div>
      <h1 className="logement_title">{title}</h1>
      <p className="logement_location">{location}</p>
    </div>
  );
}
